import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const DisplayLove =(prop)=> {

    console.log(prop);
    console.log("i m from com. lovedis");
    if (prop.data == "loading") {

        console.log("i m frm loading if");
         return  <Text>Please wait someting</Text>

      }
    if (prop.data.message) {
        console.log("i m frm prop message");
      return <Text>Someting went wrong, try again</Text>
    }
    else {
    return (
        <View style={styles.container}>
            <Text>{prop.data.percentage}</Text>
            <Text>{prop.data.result}</Text>
        </View>
    )
 }
}

export default DisplayLove;

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#FFF',

    },
});
